import React from "react";
import "../App.css";

export const Menu = () => {
  return (
    <div className="container">
      <div className="row">

      <div className="col order-first">
          <ul></ul>
            <h1> Libros Prestados</h1>
            <button className="firstB"></button>
            </div>
        <div className="col order-medio">
          <ul></ul>
          <h1> Registrar Prestado</h1>
          <button className="medioB"></button>
        </div>

        <div className="col last">
        <ul></ul>
          <h1> Libros Disponibles</h1> <br></br>
          <button className="lastB"></button>
        </div>
        </div>
    </div>
  );
};
